INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES
(1, 4, '2019-09-27 18:36:52', 'Deprecation Notice', 'Catalog Search is currently configured to use the MySQL engine, which has been deprecated. Consider migrating to one of\nthe Elasticsearch engines now to ensure there are no service interruptions during your next upgrade.', '', 1, 0),
(2, 4, '2019-10-01 16:15:34', 'It’s time to take your operations in a new direction by diversifying your revenue streams. ', 'We’ve got five ways you can effortlessly boost sales while reaching a wider audience. Download this informative guide and start fast-tracking your revenue growth today. Link: http://bit.ly/2m6svAN', 'http://bit.ly/2m6svAN', 1, 0),
(3, 4, '2019-10-08 18:50:49', 'It’s time to get your digital business out of the slow lane. ', 'Accelerate your revenue growth and drive customer satisfaction with these 5 must-have eCommerce features. Download this informative guide: http://bit.ly/2lLFOX6', 'http://bit.ly/2lLFOX6', 1, 0),
(4, 1, '2019-10-09 19:59:13', 'Magento Open Source 2.3.3 delivers important security updates along with performance and functionality enhancements – 10/9/2019 ', 'The latest release of Magento Open Source 2.3.3, Magento Open Source 2.2.10 and our new security-only patch 2.3.2-p2 are now available. Magento Open Source 2.3.3 includes important security enhancements along with new features, improved performance, and quality. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. For more information about security updates included in these versions of Magento please see our Security Center: https://magento.com/security/', 'https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html', 1, 0),
(5, 1, '2019-10-14 15:58:01', 'Important hotfix for Magento Open Source 2.3.3', 'A hotfix for Magento Open Source 2.3.3 has been published to address an issue related to Elasticsearch that may present itself during or after upgrading to our latest 2.3.3 release. We strongly recommend that everyone upgrading to 2.3.3, download and apply this hotfix prior to deployment. For more information please visit our release notes. https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html ', 'https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html', 1, 0),
(6, 4, '2019-10-16 13:53:12', 'You are invited: The True Cost Savings of Magento Commerce Webinar', 'Join other Magento Open Source customers for a live webinar on October 30th with commerce experts Matthew Boland and John Glasgow from Adobe to learn how upgrading from Open Source to Magento Commerce can trim your costs and deliver major ROI. Register today: http://bit.ly/2BcYK5A', 'http://bit.ly/2BcYK5A', 1, 0),
(7, 4, '2019-10-23 12:49:48', 'eBook: Advanced Strategies for Fast-Tracking Revenue Growth', 'Take your business in a new direction by selling more to a larger audience. Our guide explains 5 ways you can quickly add new revenue streams to your business. Link here: http://bit.ly/2m6svAN', 'http://bit.ly/2m6svAN', 1, 0),
(8, 4, '2019-11-11 18:31:19', 'Special Offer for Open Source Customers through November 29th.', 'Take advantage of a special discount when you move to a Magento Commerce cloud subscription (formerly Enterprise Edition) through November 29th. With exciting new features like Page Builder and Content Staging and Preview, now is the perfect time to contact us. Link here: http://bit.ly/2O4hPNg', 'http://bit.ly/2O4hPNg', 1, 0),
(9, 4, '2019-11-14 16:36:56', 'We need your help! How do you fulfill and ship your orders?', 'We need your help! How do you fulfill and ship your orders?', 'http://selfserve.decipherinc.com/survey/selfserve/9d5/g013/191028 ', 1, 0),
(10, 4, '2019-12-02 15:09:11', '2020: The Year You Reimagine Your Mobile Platform', 'Smarter, faster mobile shopping experiences are now achievable with Progressive Web App technology. Forrester reveals how to leverage this next-generation technology, now available on Magento Commerce 2. Reimagine your mobile environment with this exclusive report.  Link here: http://bit.ly/2W5r4zg', 'http://bit.ly/2W5r4zg ', 1, 0),
(11, 4, '2019-12-09 18:08:56', 'Online B2B purchases are set to skyrocket to $9 trillion in the US alone this year. Get in on the action with B2B and B2C selling.', 'The lines between B2B and B2C commerce are blurring. Here’s 5 reasons to go hybrid with your commerce strategy in 2020. http://bit.ly/2DPgAx0', 'http://bit.ly/2DPgAx0', 1, 0),
(12, 4, '2019-12-16 18:39:06', 'Did you know? A whopping 89% of B2B businesses now rely on digital content to guide their purchasing process.', 'Learn how you can integrate compelling content into your B2B sales strategy with our latest eBook. Download Now: http://bit.ly/368QIbu', 'http://bit.ly/368QIbu', 0, 0),
(13, 4, '2020-01-02 18:26:08', 'Are you set up to achieve your eCommerce goals? Make upgrading your resolution for 2020.', 'Upgrading to Magento Commerce might cost less than you think. Watch our webinar to learn the true cost savings of upgrading to Magento Commerce 2. Watch Now: http://bit.ly/2BcYK5A', 'http://bit.ly/2BcYK5A', 0, 0),
(14, 4, '2020-01-13 18:02:52', 'eCommerce is an ocean of opportunity. Take our quiz and find out if you are a pilot fish, octopus, or shark.', 'Find out if you’re ready to sell with the big fish by taking our brief quiz designed to identify your competitive selling potential. Answer our set of quick questions to see where you stack up and receive personalized resources to give your digital growth strategy some teeth. http://bit.ly/2NkNvhS', 'http://bit.ly/2NkNvhS', 0, 0),
(15, 4, '2020-01-21 17:05:32', '2020 goal: Is your product content keeping up with your customers?', 'Magento Page Builder gives you fast content updates and even faster growth. Download our eBook to learn more. Link here: http://bit.ly/2NyTuQf', 'http://bit.ly/2NyTuQf', 0, 0),
(16, 4, '2020-01-27 16:01:40', 'Learn The 6 Sweet Features Behind Every Irresistible eCommerce Experience. ', '92% percent of online shoppers call it quits before checkout over poor site performance. Discover the six essential features your commerce platform needs to create truly memorable customer moments. Link here: http://bit.ly/2RrcS4d\n', 'http://bit.ly/2RrcS4d', 0, 0),
(17, 1, '2020-01-28 20:09:22', 'Magento Open Source 2.3.4 delivers important security updates and features to help you build a more engaging customer experience – 1/28/2020', 'The latest releases of Magento Open Source – 2.3.4, 2.3.3-p1, and 2.2.11 – are now generally available. The latest release of Magento Open Source includes important security enhancements along with new functionality and platform quality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. Learn how this release can help you build a more engaging customer experience at Magento.com/blog.', 'https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html', 0, 0),
(18, 4, '2020-02-03 19:53:41', 'You are invited: Seize the New Year– 5 Growth Strategies for 2020.', 'Join us for a live webinar on February 13th with Magento experts Shannon Hane and Matthew Wasley from Adobe to learn the latest eCommerce strategies to accelerate revenue growth in 2020. Register today: http://bit.ly/2GPpb4b', 'http://bit.ly/2GPpb4b', 0, 0);
