(67, 85, 0, 21, 'Моторное масло Neste Oil City Pro 5W 40'),
(68, 75, 0, 22, '<p>Лорем ипсум долор сит амет, виси лобортис ин при. Идяуе цорпора елояуентиам усу не, еу яуидам нумяуам либерависсе сит. Миним цопиосае еи сит, витуперата аппеллантур хас ат. Те еум алияуип утрояуе, мовет иудицо ат нец, нумяуам улламцорпер еум не.</p>\r\n<p>Ин цум неморе антиопам инструцтиор, ад адхуц легере перципитур усу. Яуо ад омниум цонвенире, нец одио солута цонцлудатуряуе те. Хас еяуидем нолуиссе елояуентиам ин, еу еам партем омниум лабитур. Ид солум путант мел, иллум мовет еверти ут вис.</p>\r\n<p> </p>'),
(69, 76, 0, 22, '<p>Лорем ипсум долор сит амет, виси лобортис ин при. Идяуе цорпора елояуентиам усу не, еу яуидам нумяуам либерависсе сит. Миним цопиосае еи сит, витуперата аппеллантур хас ат. Те еум алияуип утрояуе, мовет иудицо ат нец, нумяуам улламцорпер еум не</p>\r\n<p> </p>'),
