(78, 76, 0, 25, '<p>ELF Tranself NFJ 75W-80 1л - Трансмиссионное масло Тип масла: Трансмиссионное масло ; Тип основы масла: синтетическое масло; SAE: 75W-80; Емкость, л: 1 ELF Tranself NFJ 75W-80 1л - Трансмиссионное масло Тип масла: Трансмиссионное масло ; Тип основы масла: синтетическое масло; SAE: 75W-80; Емкость, л: 1 ELF Tranself NFJ 75W-80 1л - Трансмиссионное масло Тип масла: Трансмиссионное масло ; Тип основы масла: синтетическое масло; SAE: 75W-80; Емкость, л: 1 ELF Tranself NFJ 75W-80 1л - Трансмиссионное масло Тип масла: Трансмиссионное масло ; Тип основы масла: синтетическое масло; SAE: 75W-80; Емкость, л: 1ELF Tranself NFJ 75W-80 1л - Трансмиссионное масло Тип масла: Трансмиссионное масло ; Тип основы масла: синтетическое масло</p>'),
(79, 85, 0, 25, 'Моторона олива Shell HX8 5W-30'),
(80, 75, 0, 26, '<p>На думку Ілона Маска, Cybertruck може виглядати «<em>занадто <a title=\"Футуризм\" href=\"https://uk.wikipedia.org/wiki/%D0%A4%D1%83%D1%82%D1%83%D1%80%D0%B8%D0%B7%D0%BC\">футуристично</a> для багатьох людей</em>». Він схожий на <a title=\"Бронетранспортер\" href=\"https://uk.wikipedia.org/wiki/%D0%91%D1%80%D0%BE%D0%BD%D0%B5%D1%82%D1%80%D0%B0%D0%BD%D1%81%D0%BF%D0%BE%D1%80%D1%82%D0%B5%D1%80\">бронетранспортер</a> майбутнього<sup id=\"cite_ref-19\" class=\"reference\"><a href=\"https://uk.wikipedia.org/wiki/Tesla_Cybertruck#cite_note-19\">[19]</a></sup> і буде куленепробивним<sup id=\"cite_ref-20\" class=\"reference\"><a href=\"https://uk.wikipedia.org/wiki/Tesla_Cybertruck#cite_note-20\">[20]</a></sup>. Його кузов виготовлятимуть із нефарбованої 3-міліметрової неіржавної сталі, яку <a title=\"SpaceX\" href=\"https://uk.wikipedia.org/wiki/SpaceX\">SpaceX</a> використовує у будівництві ракети <a title=\"BFR\" href=\"https://uk.wikipedia.org/wiki/BFR\">BFR</a>. Ця сталь витримує постріли патронами <a title=\"9×19 мм Парабелум\" href=\"https://uk.wikipedia.org/wiki/9%C3%9719_%D0%BC%D0%BC_%D0%9F%D0%B0%D1%80%D0%B0%D0%B1%D0%B5%D0%BB%D1%83%D0%BC\">9 мм</a>, хоча офіційної сертифікації на куленепробійність не проводилося<sup id=\"cite_ref-21\" class=\"reference\"><a href=\"https://uk.wikipedia.org/wiki/Tesla_Cybertruck#cite_note-21\">[21]</a></sup>. Схожий на <a title=\"Оригамі\" href=\"https://uk.wikipedia.org/wiki/%D0%9E%D1%80%D0%B8%D0%B3%D0%B0%D0%BC%D1%96\">оригамі</a> дизайн авто, а конкретно — його пласкі форми, Маск пояснив складністю обробки холоднокатаної сталі, під час <a title=\"Штампування\" href=\"https://uk.wikipedia.org/wiki/%D0%A8%D1%82%D0%B0%D0%BC%D0%BF%D1%83%D0%B2%D0%B0%D0%BD%D0%BD%D1%8F\">штампування</a> якої ламаються штампи.</p>\r\n<p>У салоні чотиридверного авто із панорамним дахом розміщено шість великих сидінь<sup id=\"cite_ref-22\" class=\"reference\"><a href=\"https://uk.wikipedia.org/wiki/Tesla_Cybertruck#cite_note-22\">[22]</a></sup> (по три у ряд), кермо у стилі гоночної машини, планшет діаметром 17\" та підключений до камери екран, замість дзеркала заднього виду</p>'),
(81, 76, 0, 26, '<p><strong>Tesla Cybertruck</strong> — <a title=\"Електромобіль\" href=\"https://uk.wikipedia.org/wiki/%D0%95%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%BC%D0%BE%D0%B1%D1%96%D0%BB%D1%8C\">електричний</a> <a title=\"Фургон\" href=\"https://uk.wikipedia.org/wiki/%D0%A4%D1%83%D1%80%D0%B3%D0%BE%D0%BD#%D1%84%D1%83%D1%80%D0%B3%D0%BE%D0%BD%D0%B8_%D0%BD%D0%B0_%D0%BE%D1%81%D0%BD%D0%BE%D0%B2%D1%96_%D0%BF%D1%96%D0%BA%D0%B0%D0%BF%D1%96%D0%B2\">фургон на основі пікапа</a> у стилі <a title=\"Кіберпанк\" href=\"https://uk.wikipedia.org/wiki/%D0%9A%D1%96%D0%B1%D0%B5%D1%80%D0%BF%D0%B0%D0%BD%D0%BA\">кіберпанку</a>, що планує випускати <a title=\"Tesla Inc.\" href=\"https://uk.wikipedia.org/wiki/Tesla_Inc.\">Tesla Inc.</a> Його <a title=\"Вантажність\" href=\"https://uk.wikipedia.org/wiki/%D0%92%D0%B0%D0%BD%D1%82%D0%B0%D0%B6%D0%BD%D1%96%D1%81%D1%82%D1%8C\">вантажність</a> — майже 1,6 т. Залежно від моделі на одному заряді проїжджатиме від 400 до 800 км. До 97 км/год (60 миль/год) розганятиметься за 2,9 секунди. Стартова ціна за найдешевшу модель — $39,900. Початок виробництва запланований на кінець 2021 року, а моделі із трьома двигунами — на кінець 2022 року<sup id=\"cite_ref-3\" class=\"reference\"><a href=\"https://uk.wikipedia.org/wiki/Tesla_Cybertruck#cite_note-3\">[3]</a></sup><sup id=\"cite_ref-4\" class=\"reference\"><a href=\"https://uk.wikipedia.org/wiki/Tesla_Cybertruck#cite_note-4\">[4]</a></sup>.</p>'),
(82, 85, 0, 26, 'Cybertrack'),
(83, 75, 0, 27, '<p>Кузов автомобіля металевий, відкритого типу, чотиримісний, двохдверний, напівнесучої конструкції із відкидним заднім бортом. За допомогою зварного з\'єднання кузов сполучений із <a title=\"Рама\" href=\"https://uk.wikipedia.org/wiki/%D0%A0%D0%B0%D0%BC%D0%B0\">рамою</a>, яка є основним несучим елементом автомобіля. Є дві комплектації даху: пластиковий або тентовий. Двері металеві, фіксуються у відкритому положенні, із знімними надставками, в які вмонтовані вікна із рухомими кватирками. <a title=\"Капот (автомобіль)\" href=\"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BF%D0%BE%D1%82_(%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D1%96%D0%BB%D1%8C)\">Капот</a> захисту моторного відсіку кріпиться за допомогою двох металевих петель на облицюванні автомобіля, і фіксується в закритому положенні замком. У відкритому положенні капот встановлюється за допомогою опори у вертикальному положенні, забезпечуючи безперешкодний доступ до силового агрегату. Задній <a class=\"mw-disambig\" title=\"Борт\" href=\"https://uk.wikipedia.org/wiki/%D0%91%D0%BE%D1%80%D1%82\">борт</a> у відкритому положенні може бути використаний при перевезенні довгих за розміром, вантажів. Площа платформи, при складених задніх сидіннях становить 1.4 м². У підлозі автомобіля знаходяться спеціальні люки для забезпечення доступу до коробки передач, заливної пробки редуктора заднього моста, бензопроводів та датчика рівня палива. Люки замикаються кришками із гумовими ущільнювачами і закріплюються гвинтами. Для захисту покриття від механічних ушкоджень, а також для покращення термо та шумоізоляції дно кузова покрите спеціальною бітумною мастикою. <a title=\"Кузов\" href=\"https://uk.wikipedia.org/wiki/%D0%9A%D1%83%D0%B7%D0%BE%D0%B2\">Кузов</a> перед фарбуванням ґрунтується. З метою підвищення періоду служби кузова, найбільш податливі до корозії частини обробляються антикорозійною сумішшю.</p>'),
(84, 76, 0, 27, '<p><strong>ЛуАЗ-969М</strong> — <a class=\"mw-redirect\" title=\"\" href=\"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D0%B2%D0%BD%D0%B8%D0%B9_%D0%BF%D1%80%D0%B8%D0%B2%D1%96%D0%B4\">повноприводний</a> <a title=\"Автомобіль\" href=\"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D1%96%D0%BB%D1%8C\">автомобіль</a>, який випускався на <a class=\"mw-redirect\" title=\"Луцький автомобільний завод, державне підприємство\" href=\"https://uk.wikipedia.org/wiki/%D0%9B%D1%83%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D1%96%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4,_%D0%B4%D0%B5%D1%80%D0%B6%D0%B0%D0%B2%D0%BD%D0%B5_%D0%BF%D1%96%D0%B4%D0%BF%D1%80%D0%B8%D1%94%D0%BC%D1%81%D1%82%D0%B2%D0%BE\">Луцькому автомобільному заводі</a> з 1979 по 1992 рік, як модифікація моделі <a title=\"ЛуАЗ-969А\" href=\"https://uk.wikipedia.org/wiki/%D0%9B%D1%83%D0%90%D0%97-969%D0%90\">ЛуАЗ-969А</a>. Від попередника відрізнявся оновленим дизайном та покращеними ходовими властивостями.</p>'),
