(19, 19, 1, 'positive', 'Purus in mollis nunc sed. Vitae et leo duis ut diam quam nulla porttitor massa. Integer eget aliquet nibh praesent. Vitae congue mauris rhoncus aenean vel elit scelerisque mauris pellentesque. Posuere urna nec tincidunt praesent semper feugiat nibh sed pulvinar. Sem integer vitae justo eget. Risus ultricies tristique nulla aliquet enim tortor at. Varius quam quisque id diam. Molestie a iaculis at erat pellentesque. At varius vel pharetra vel turpis. Sem fringilla ut morbi tincidunt augue interdum velit euismod. Venenatis lectus magna fringilla urna porttitor rhoncus dolor purus. Cursus metus aliquam eleifend mi in nulla. Nunc mi ipsum faucibus vitae aliquet nec ullamcorper sit amet. Volutpat est velit egestas dui id ornare arcu odio ut. Sit amet purus gravida quis blandit. Massa massa ultricies mi quis hendrerit dolor magna eget. Ultrices vitae auctor eu augue ut lectus.', 'Ben', NULL),
(20, 20, 1, 'Круто', 'Чекаю щоб він вже вийшов у виробництво... Крута буде автівка! Загалом дизайн мені сподобався (попри значну критику)... Люди завжди щось нове критикують. Вражає його ціна.... Як на мене - не дороге авто з такими характеристиками. Можли, коли воно вже нарешті буде в продажі, я вже й матиму достатньо грошей, щоб придбати його....', 'Vasyl', NULL),
(21, 21, 4, 'positive', 'It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'Philip', NULL),
(22, 22, 3, 'positive', 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.', 'Sam', NULL),
(23, 23, 3, 'negative', 'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.', 'Geralt', NULL),
(24, 24, 3, 'so-so', 'Donec rhoncus arcu leo, condimentum congue ex dapibus ac. Vestibulum mollis mattis nisi, id imperdiet sapien hendrerit ac. Sed sodales vel turpis nec lacinia. Aliquam erat volutpat. Cras eu purus ante. Nulla non finibus urna. Maecenas porta sapien et pellentesque sagittis. Fusce neque diam, viverra sed velit eget, placerat placerat nisl. Quisque at massa nunc. Aenean id sagittis justo. Nulla tristique hendrerit leo, at sodales libero maximus in. Cras rutrum dui magna, fermentum euismod lectus condimentum at. Phasellus fringilla sagittis lacus, sit amet suscipit metus. Sed vel tristique urna, non laoreet quam. Etiam sollicitudin lacus quis sollicitudin semper. Aenean efficitur sed tellus id maximus.', 'Yennefer', NULL),
(25, 25, 3, 'test3', 'Nulla non est nisi. Aenean volutpat felis ex, eget tincidunt erat volutpat eu. Proin id efficitur sem. Duis maximus elit ut euismod facilisis. Integer egestas vel purus nec eleifend. Nam vitae feugiat neque, eu eleifend nunc. Quisque in elit vitae tortor vehicula convallis. Proin et blandit magna. Aliquam sed ultricies nisi. Integer diam odio, vulputate et sapien non, ultricies luctus elit. Nulla facilisi.', 'Tsiri', NULL);
